import React from 'react';
import { Box, Typography, List, ListItem, ListItemText } from '@mui/material';
import mascotImage from '../assets/mascot.png'; 

function Mascot({ highlightedProperties, onPropertyClick }) {
  return (
    <Box
      className="mascot-container"
    >
      <img src={mascotImage} alt="Mascot" className="mascot-icon" />
      <Box className="mascot-info">
        <Typography variant="h6" gutterBottom>Properties</Typography>
        <List>
          {highlightedProperties.map((property) => (
            <ListItem
              button
              key={property.id}
              onClick={() => onPropertyClick(property)}
            >
              <ListItemText
                primary={`Property ID: ${property.id}`}
                secondary={`Builder: ${property.Builder}`}
              />
            </ListItem>
          ))}
        </List>
      </Box>
    </Box>
  );
}

export default Mascot;
